import React from "react";
import "./buttons.css";

const Buttons = ({ url, title, type }) => {
  let renderedButton = null;

  switch (type) {
    case "external":
      renderedButton = (
        <a href={url} target="_blank">
          {title}
        </a>
      );
      break;
    case "internal":
      enderedButton = (
        <a href={url} target="_blank">
          {title}
        </a>
      );
      break;
    default:
      renderedButton = null;
  }
  return (
    <div className="button">
      <a href={url} target="_blank">
        {title}
      </a>
    </div>
  );
};

export default Buttons;
